import React from "react";
import "./Table.scss";
const table = ({ data }) => {
  let titles = [];
  let row = [];
  if (data) {
    titles = Object.keys(data[0]);

    row = data.map((row, i) => (
      <tr className="row">
        {Object.keys(row).map((item, i) => (
          <td key={i}>{row[item]}</td>
        ))}
      </tr>
    ));
  }

  return (
    <div className="table">
      <h2>Frequently Requested Materials</h2>
      <table className="content-table">
        <thead>
          <tr className="bg-primary">
            {titles.map((title) => (
              <th key={title}>{title}</th>
            ))}
          </tr>
        </thead>

        <tbody>{row}</tbody>
      </table>
    </div>
  );
};

export default table;
